import Home from "./Home";
// import WorkoutPlans from "./WorkoutPlans";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Reviews from "./Reviews"

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
        <Switch>
          <Route path="/reviews">
            <Reviews />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
